import Post from './Post';

class Timeline extends Component {
    constructor(props) {
        super(props)
        this.state = {
            posts: ""
        }

    }

    render () {
        return (
            <div className = "container">
            <Post />
            <Post />
            <Post />
            <Post />
            </div>

        )
    }


}



export default Timeline;
